import React, { useState } from 'react';
import '../Calculator/CalcuStyle.css';
import { Home } from '@material-ui/icons';


const CalcuHome = () => {

       const {result, setResult} = useState("45");

    return (
        <>
    <div className="main">
    <div className="display"> <h3 className="text-right shadow shadow-lg"> {result} </h3>
        <p id="history"><i className="fa fa-history" aria-hidden="true"></i>&nbsp;Result</p>
        <h2 id="result">6788689</h2>
    </div>
    <div className="buttons"> <button id="clear">C</button> <button id="delete_single_num"><i className="text-danger" aria-hidden="true">Del</i></button> <button id="Normal_btn">/</button> <button id="Normal_btn">*</button> </div>
    <div className="buttons"> <button id="Normal_btn">7</button> <button id="Normal_btn">8</button> <button id="Normal_btn">9</button> <button id="Normal_btn">-</button> </div>
    <div className="buttons"> <button id="Normal_btn">4</button> <button id="Normal_btn">5</button> <button id="Normal_btn">6</button> <button id="Normal_btn">+</button> </div>
    <div className="buttons"> <button id="Normal_btn">1</button> <button id="Normal_btn">2</button> <button id="Normal_btn">3</button> <button id="Normal_btn">.</button> </div>
    <div className="buttons"> <button id="Normal_btn">0</button> <button id="Normal_btn">00</button> <button id="equalTo">=</button> </div>
</div>
        </>
    )
}

export default CalcuHome
